description.text:
An EXTREMELY poorly written attempt at making a heart shape out of a mobius strip. Using the following equation x=16sin^3(theta), y=13cos(theta)-5cos(2<em >theta)-2cos(3</em>theta)-cos(4*theta) taken from <a rel="nofollow" href="http://mathworld.wolfram.com/HeartCurve.html" >http://mathworld.wolfram.com/HeartCurve.html</a>
There are 3 cross sectional shapes to choose from: rectangle, ellipse and pill
Oh, also there is code in here for a standard round mobius shape I used as a sanity check if you want to comment it back in... just added a variable (heart) to let you use a ring or heart shape set it to 1 or 0 respectively
Rendering this in openscad will take a disgraceful amount of time at present. My old crappy work computer's fan has been screaming for 15 minutes working on this.
Key Variables:
angular_resolution=1;//how many degrees per cross sectional shape, smaller implies higher quality, if you see gaps between the segments of your model  decrease this or increase extrude_height
//shapes, set a single of these items to 1 the rest 0 i.e. for ellipse shape...<br />
cs_pill_shape=0;<br />
cs_ellipse_shape=1;<br />
cs_rectangle_shape=0;
//<br />
shape_dimension_a=3;//how long your cross sectional shape is<br />
shape_dimension_b=1;//how wide your cross sectional shape is
//if you see gaps between the segments of your model increase this or decrease angular resolution<br />
extrude_height=0.1;

